import React from "react";
import { BrowserRouter, Link, Route, Routes as Switch } from "react-router-dom";

const User = () => {
  return <div>User Page</div>;
};

const Home = () => {
  return <div>Home Page</div>;
};

export default function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <nav>
          <div>
            <Link to="/">Home</Link>
          </div>
          <div>
            <Link to="/user/:id">User</Link>
          </div>
        </nav>
        <Switch>
          <Route path="/user/:id">
            <User />
          </Route>
          <Route path="/" exact>
            <Home />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}
